import * as React from "react";
import {Container, Paper} from "@mui/material";
import Box from "@mui/material/Box";
import ymaps3 from "@yandex/ymaps3-reactify";
import ReactDOM from "react-dom/client";

export default async function PlaceInformation() {

    const paperStyle = {
        padding: "50px 20px",
        width: "95%",
        margin: "20px auto",
        borderRadius: 20,
        backgroundColor: "#e9dbd3"
    }

    const ymaps3Reactify = await ymaps3.import('@yandex/ymaps3-reactify');
    const reactify = ymaps3Reactify.reactify.bindTo(React, ReactDOM);
    const {YMap, YMapDefaultSchemeLayer, YMapDefaultFeaturesLayer, YMapMarker} = reactify.module(ymaps3);


    return (
        <Container>
            <Paper elevation={3} style={paperStyle}>
                <Box>
                    <h1>Место Проведения</h1>

                    <h3 className="textContent" style={{fontSize: "2rem"}}>
                        "Villa Небеса"
                        <tr/>
                        Ул. Техническая, 4б
                    </h3>

                    <div style={{width: "600px", height: "400px"}}>
                        <YMap location={{center: [25.229762, 55.289311], zoom: 9}} mode="vector">
                            <YMapDefaultSchemeLayer />
                            <YMapDefaultFeaturesLayer />

                            <YMapMarker coordinates={[25.229762, 55.289311]} draggable={true}>
                                <section>
                                    <h1>You can drag this header</h1>
                                </section>
                            </YMapMarker>
                        </YMap>
                    </div>

                </Box>
            </Paper>
        </Container>
    );
}
